import React from 'react'
import { useEffect, useState } from 'react'

const Widget = () => {
    const [data,setData] = useState([])
    useEffect(()=>{
        fetch('https://api.coinlore.net/api/tickers/?start=100&limit=5')
        .then((res)=>res.json())
        .then((response)=>{
            setData(response.data)
        })
    })

  return (

    <div>

    </div>
  )
}

export default Widget
